import React,{useState,useEffect} from "react";
import classes from "./TicketProp.module.css"
import {getuserbyId, getcategorybyId} from '../../../CommonApps/AllAPICalls';

import {BsFillRecordFill} from 'react-icons/bs';


const TicketProp = (props) =>{



const userId=props.data.author;
const ticketCategory = props.data.category;



const [userData, setUserData ] = useState({});
const [catData, setCatData] = useState({});


useEffect(() =>{

   getuserbyId({userId, setUserData});

  },[userId]);


useEffect(()=>{

   getcategorybyId({ticketCategory, setCatData});

},[ticketCategory]);





return(

<div className={classes.ticketProp}>

   <div className={classes.info}> 
     <button className={classes.proptitlebtn}> <b>Details</b></button>
     <ul className={classes.listStyleType}>
      <div className={classes.oneInfoDiv}> 
	    <BsFillRecordFill className={classes.bulletIcon}/>
	    <span className={classes.params}>Category:</span>  {catData.name}
      </div>
      <div className={classes.oneInfoDiv}> 
	   <BsFillRecordFill className={classes.bulletIcon}/>
	   <span className={classes.params}>Priority:</span> {props.data.priority}
      </div>
      <div className={classes.oneInfoDiv}> 
	   <BsFillRecordFill className={classes.bulletIcon}/>
	   <span className={classes.params}>Status:</span>  
	   { props.data.status==="open" &&
	   <span className={classes.statusholder} style={{background:"var(--greenColor1)",color:"whhite"}}> <b> {props.data.status} </b></span>
	   }	   
      </div>	
      <div className={classes.oneInfoDiv}> 
	  <BsFillRecordFill className={classes.bulletIcon}/>
	  <span className={classes.params}>Resolution:</span> {props.data.resolution} 
      </div>

     </ul>
  </div>

  <div className={classes.people}>

     <button className={classes.proptitlebtn}> <b>People</b></button>	

     <ul>
        <div className={classes.oneInfoDiv}> 
	    <BsFillRecordFill className={classes.bulletIcon}/> 
	    <span className={classes.params}>Created by :</span>  {userData.firstname} {userData.lastname}
	</div>
        <div className={classes.oneInfoDiv}> 
	   <BsFillRecordFill className={classes.bulletIcon}/>
	   <span className={classes.params}>Last updated by :</span> Ipsita Nanda 
	</div>
        <div className={classes.oneInfoDiv}> 
	    <BsFillRecordFill className={classes.bulletIcon}/>
	    <span className={classes.params}>Visibility :</span> All 
	</div>	 
     </ul>

  </div>

   <div className={classes.dates}> 
      <button className={classes.proptitlebtn}> <b>Dates</b></button>
      <ul>
        <div className={classes.oneInfoDiv}>
	      <BsFillRecordFill className={classes.bulletIcon}/>
	      <span className={classes.params}>Created at :</span>  {props.data.created_at}
	</div>
        <div className={classes.oneInfoDiv}>
	     <BsFillRecordFill className={classes.bulletIcon}/>
	    <span className={classes.params}>Last updated at :</span> June 2021 
	</div>

     </ul>
   </div>



</div>

);

}

export default TicketProp;
